// SPDX-License-Identifier: MIT
// Written by @0xmend
pragma solidity ^0.8.9;
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "base64-sol/base64.sol";
contract Mendables is ERC721Enumerable {
    using Strings for uint256;
    uint256 public maxSupply = 1337;
    uint256 public baseCost = 0.03 ether;
    uint256 public updateCost = 0.01 ether;
    uint256 public maxMintsInOne = 5;
    bool public salePaused = true;
    string public uiURI;
    string public defaultImageURI;
    address public owner;
    string public contractMetadata;
    string public osdescription;
    struct Mendable {
        string imageURI;
        string caption;
        string category;
        string referenceURI;
        string referenceName;
        mapping(address => uint256) expressed;
        uint256 expressions;
        uint256 edits;
    }
    struct MendableInput {
        string imageURI;
        string caption;
        string category;
        string referenceURI;
        string referenceName;
    }
    mapping(uint256 => Mendable) public mendables;
    constructor(string memory _contractMetadata, string memory _defaultImageURI, string memory _uiURI, string memory _desc) 
    ERC721("Mendables", "MEND") {
        owner = msg.sender;
        contractMetadata = _contractMetadata;
        defaultImageURI = _defaultImageURI;
        uiURI = _uiURI;
        osdescription = _desc;
    }
    function express(uint256 tokenId) external {
        uint256 balance = balanceOf(msg.sender);
        require(balance > 0, "No Mendables");
        uint256 edits = mendables[tokenId].edits + 1;
        uint256 mendableVotes = balance * edits;
        uint256 expressionsMade = mendables[tokenId].expressed[msg.sender];
        uint256 pastVotes = expressionsMade / edits;
        require(expressionsMade != mendableVotes, "Already expressed");
        mendables[tokenId].expressed[msg.sender] = mendableVotes;
        if(mendables[tokenId].expressions >= pastVotes){
            mendables[tokenId].expressions = mendables[tokenId].expressions - pastVotes + balance;
        } else {
            mendables[tokenId].expressions += balance;
        }
    }
    function expressed(uint256 tokenId) public view returns(bool) {
        uint256 balance = balanceOf(msg.sender);
        if(balance > 0){
            uint256 mendableVotes = balance * (mendables[tokenId].edits + 1);
            uint256 expressionsMade = mendables[tokenId].expressed[msg.sender];
            return(expressionsMade == mendableVotes);
        } 
        return false;
    }
    function _updateMendable(uint256 id, MendableInput memory m, uint256 mode) internal returns (uint256){
        require(bytes(m.imageURI).length<75, '');
        require(bytes(m.caption).length<281, '');
        require(bytes(m.category).length<17, '');
        require(bytes(m.referenceURI).length<75, '');
        require(bytes(m.referenceName).length<33, '');
        mendables[id].caption = m.caption;
        mendables[id].category = m.category;
        mendables[id].imageURI = m.imageURI;
        mendables[id].referenceName = m.referenceName;
        mendables[id].referenceURI = m.referenceURI;
        mendables[id].expressions = 0;
        mendables[id].edits = (mode == 0) ? 0 : mendables[id].edits + 1;
        return id;
    }    
    function _mintMendable(address to, uint256 amount, uint256 supply) internal {
        for (uint256 i = 1; i <= amount; i++) {
            _safeMint(to, supply + i);
        }
    }
    function mint(uint256 _mintAmount) external payable {
        uint256 mintCost = baseCost;
        if (msg.sender == owner) {
            mintCost = 0;
        } else {
            require(!salePaused, "Sale Paused");
            require(_mintAmount <= maxMintsInOne, "");
        }
        require(_mintAmount > 0, "");
        uint256 supply = totalSupply();
        require(supply + _mintAmount <= maxSupply, "Sold out!");
        require(msg.value >= mintCost * _mintAmount, "Insufficient funds");
        _mintMendable(msg.sender, _mintAmount, supply);
    }
    function personalizeMint(address to, MendableInput memory mend) external payable {
        uint256 mintCost = baseCost;
        if (msg.sender == owner) {
            mintCost = 0;
        } else {
            require(!salePaused, "Sale is paused");
        }
        uint256 supply = totalSupply();
        require(supply + 1 <= maxSupply, "Sold out!");
        require(msg.value >= mintCost, "Insufficient funds");
        _mintMendable(to, 1, supply);
        _updateMendable(supply + 1, mend, 0);
    }
    function airdrop(address to, uint256 _mintAmount) external  {
        require(msg.sender == owner, "Unauthorized");
        require(_mintAmount > 0, "Mint amount > 0");
        uint256 supply = totalSupply();
        require(supply + _mintAmount <= maxSupply, "Sold out!");
        _mintMendable(to, _mintAmount, supply);
    }
    function updateMendable(uint256 id, MendableInput memory mend) external payable {
        require(ownerOf(id)==msg.sender || msg.sender == owner, "Unauthorized");
        require(msg.value >= updateCost, "Less funds");
        _updateMendable(id, mend, 1);
    }
    function genTokenURI(uint256 tokenId) public view returns (string memory) {
        string memory image = bytes(mendables[tokenId].imageURI).length == 0 ? defaultImageURI : mendables[tokenId].imageURI;
        uint256 expressions = mendables[tokenId].expressions;
        return string(abi.encodePacked("data:application/json;base64,",Base64.encode(bytes(abi.encodePacked('{"name":"',string(abi.encodePacked("Mendables #", Strings.toString(tokenId))),'","attributes": [{"trait_type":"Category","value":"',mendables[tokenId].category,'"},{"trait_type":"Expressions","value":',Strings.toString(expressions),',"max_value":',Strings.toString(maxSupply), '}',']',', "description":"',osdescription,'", "image":"',image,'", "animation_url":"',string(abi.encodePacked(uiURI, "#", Strings.toString(tokenId))),'"}')))));
    }
    string erm = "";
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return genTokenURI(tokenId);   
    }
    function contractURI() public view returns (string memory) {
        return contractMetadata;
    }
    function pauseSale(bool _state) external {
        require(msg.sender == owner, erm);
        salePaused = _state;
    }
    function setDefaultImage(string memory _uri) external {
        require(msg.sender == owner, erm);
        defaultImageURI = _uri;
    }
    function setInterfaceURI(string memory _uri) external {
        require(msg.sender == owner, erm);
        uiURI = _uri;
    }
    function setContractURI(string memory _uri) external {
        require(msg.sender == owner, erm);
        contractMetadata = _uri;
    }
    function setDescription(string memory _d) external {
        require(msg.sender == owner, erm);
        osdescription = _d;
    }
    function setBaseCost(uint256 _newCost) external {
        require(msg.sender == owner, erm);
        baseCost = _newCost;
    }
    function setUpdateCost(uint256 _newCost) external {
        require(msg.sender == owner, erm);
        updateCost = _newCost;
    }
    function withdraw() external {
        require(msg.sender == owner, erm);
        payable(owner).transfer(address(this).balance);
    }
}
